import Header from "../../components/Header";
import Consultas from "../../components/Consultas";
import Footer from "../../components/Footer";
import Routes from "../../routes";

function ConsultasPage() {
    return (
        <div className='app'>
            <Routes />
            <Header />
            <Consultas />
            <Footer />
        </div>
    )
}

export default ConsultasPage
